import React, {Component} from "react";
import {compose} from "redux";
import {connect} from "react-redux";
import {getContacts} from "../../Redux/contacts-reducer";
import {witchAuthRedirect} from "../../Redirect/authRedirect";

class PersonalAreaContainer extends Component {
    render() {
        return (
            <div>Личный кабинет</div>
        )

    }
}

const mapStateToProps = (state) => ({
    contacts: state.contactsPage.contacts,
    isAuth: state.auth.isAuth,
})

export default compose(
    connect(mapStateToProps, {getContacts}),
    withRouter,
    witchAuthRedirect) (PersonalAreaContainer)
